import React, { useEffect } from 'react';
import { Helmet } from 'react-helmet';

const Page = (props: any) => {
  const { title, children, ...rest } = props;

  return (
    <div {...rest}>
      <Helmet>
        <title>{title}</title>
      </Helmet>
      {children}
    </div>
  );
};

export default Page;
